                <div className="col-10 mx-auto">

        <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1">
            <h1>Grow your Business with <strong className="brand">Sandeep</strong></h1>
            <h2 className="my-3">We are the team talented developer making website</h2>
            <div className="mt-3">
                <a href="#" className="btn btn-danger">Get Started</a>
            </div>
        </div>
                
